CREATE DATABASE web_books;

USE web_books;

CREATE TABLE users (
  id int NOT NULL AUTO_INCREMENT,
  username varchar(32) DEFAULT NULL,
  password varchar(255) DEFAULT NULL,
  scope varchar(255) DEFAULT NULL,
  name varchar(255) DEFAULT NULL,
  role_id int DEFAULT NULL,
  PRIMARY KEY (id),
  UNIQUE KEY id (id),
  UNIQUE KEY users_id_unique (id)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


CREATE TABLE author (
    author_id INT NOT NULL AUTO_INCREMENT,
    author_name VARCHAR(400),
    CONSTRAINT pk_author PRIMARY KEY (author_id)
);

CREATE TABLE publisher (
    publisher_id INT NOT NULL AUTO_INCREMENT,
    publisher_name VARCHAR(400),
    CONSTRAINT pk_publisher PRIMARY KEY (publisher_id)
);

CREATE TABLE book_language (
    language_id INT NOT NULL AUTO_INCREMENT,
    language_code VARCHAR(8),
    language_name VARCHAR(50),
    CONSTRAINT pk_language PRIMARY KEY (language_id)
);

CREATE TABLE book (
    book_id INT NOT NULL AUTO_INCREMENT,
    title VARCHAR(400),
    isbn13 VARCHAR(13),
    language_id INT,
    num_pages INT,
    publication_date DATE,
    publisher_id INT,
    book_img VARCHAR(100),
    borrowed TINYINT(1) NOT NULL DEFAULT 0,
    CONSTRAINT pk_book PRIMARY KEY (book_id),
    CONSTRAINT fk_book_lang FOREIGN KEY (language_id) REFERENCES book_language (language_id),
    CONSTRAINT fk_book_pub FOREIGN KEY (publisher_id) REFERENCES publisher (publisher_id)
);

CREATE TABLE book_author (
    book_id INT NOT NULL AUTO_INCREMENT,
    author_id INT,
    CONSTRAINT pk_bookauthor PRIMARY KEY (book_id, author_id),
    CONSTRAINT fk_ba_book FOREIGN KEY (book_id) REFERENCES book (book_id),
    CONSTRAINT fk_ba_author FOREIGN KEY (author_id) REFERENCES author (author_id)
);

CREATE TABLE oauth_scopes (
  id int NOT NULL AUTO_INCREMENT,
  scope varchar(80) DEFAULT NULL,
  is_default tinyint(1) DEFAULT NULL,
  PRIMARY KEY (id),
  UNIQUE KEY id (id),
  UNIQUE KEY oauth_scopes_id_unique (id)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE oauth_refresh_tokens (
  id int NOT NULL AUTO_INCREMENT,
  refresh_token varchar(256) DEFAULT NULL,
  expires varchar(500) DEFAULT NULL,
  scope varchar(255) DEFAULT NULL,
  client_id int DEFAULT NULL,
  user_id int DEFAULT NULL,
  PRIMARY KEY (id),
  UNIQUE KEY id (id),
  UNIQUE KEY oauth_refresh_tokens_id_unique (id),
  KEY client_id (client_id),
  KEY user_id (user_id),
  CONSTRAINT oauth_refresh_tokens_ibfk_1 FOREIGN KEY (client_id) REFERENCES oauth_clients (id) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT oauth_refresh_tokens_ibfk_2 FOREIGN KEY (user_id) REFERENCES users (id) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE oauth_clients (
  id int NOT NULL AUTO_INCREMENT,
  name varchar(255) DEFAULT NULL,
  client_id varchar(80) DEFAULT NULL,
  client_secret varchar(80) DEFAULT NULL,
  redirect_uri varchar(2000) DEFAULT NULL,
  grant_types varchar(80) DEFAULT NULL,
  scope varchar(255) DEFAULT NULL,
  user_id int DEFAULT NULL,
  PRIMARY KEY (id),
  UNIQUE KEY id (id),
  UNIQUE KEY oauth_clients_id_unique (id),
  KEY user_id (user_id),
  CONSTRAINT oauth_clients_ibfk_1 FOREIGN KEY (user_id) REFERENCES users (id) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE oauth_authorization_codes (
  id int NOT NULL AUTO_INCREMENT,
  authorization_code varchar(256) DEFAULT NULL,
  expires varchar(500) DEFAULT NULL,
  redirect_uri varchar(2000) DEFAULT NULL,
  scope varchar(255) DEFAULT NULL,
  client_id int DEFAULT NULL,
  user_id int DEFAULT NULL,
  PRIMARY KEY (id),
  UNIQUE KEY id (id),
  UNIQUE KEY oauth_authorization_codes_id_unique (id),
  KEY oauth_client_id (client_id),
  KEY user_id (user_id),
  CONSTRAINT oauth_authorization_codes_ibfk_1 FOREIGN KEY (client_id) REFERENCES oauth_clients (id) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT oauth_authorization_codes_ibfk_2 FOREIGN KEY (user_id) REFERENCES users (id) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE oauth_access_tokens (
  id int NOT NULL AUTO_INCREMENT,
  access_token varchar(256) DEFAULT NULL,
  expires varchar(500) DEFAULT NULL,
  scope varchar(255) DEFAULT NULL,
  client_id int DEFAULT NULL,
  user_id int DEFAULT NULL,
  PRIMARY KEY (id),
  UNIQUE KEY id (id),
  UNIQUE KEY oauth_access_tokens_id_unique (id),
  KEY oauth_client_id (client_id),
  KEY user_id (user_id),
  CONSTRAINT oauth_access_tokens_ibfk_1 FOREIGN KEY (client_id) REFERENCES oauth_clients (id) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT oauth_access_tokens_ibfk_2 FOREIGN KEY (user_id) REFERENCES users (id) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE borrow (
    borrow_id INT NOT NULL AUTO_INCREMENT,
    book_id INT,
    user_id INT,
    date_borrow varchar(500) DEFAULT NULL,
    is_return TINYINT(1) NOT NULL DEFAULT 0,
    date_return varchar(500) DEFAULT NULL,
    PRIMARY KEY (borrow_id)
);










